        <style>
            .challenge-container,.challenge-item {
                align-items: center;
                display: flex
            }

            *,::after,::before {
                box-sizing: border-box;
                margin: 0;
                padding: 0;
                position: relative;
                font-weight: 400;
                outline: 0;
                border: none
            }

            body {
                color: #313131;
                line-height: 1.5;
                font-size: 16px;
                font-weight: 400;
                font-family: system-ui,-apple-system,BlinkMacSystemFont,Segoe UI,Roboto,Helvetica Neue,Arial,Noto Sans,sans-serif;
                text-rendering: optimizeLegibility;
                -webkit-font-smoothing: antialiased;
                -moz-osx-font-smoothing: grayscale
            }

            h1 {
                font-size: 2.5rem;
                font-weight: 500
            }

            h2 {
                font-size: 1.4rem
            }

            main {
                margin: 8rem auto;
                padding: 0 1.5rem;
                width: 100%;
                max-width: 60rem
            }

            .content {
                height: 100px;
                margin: 2rem 0
            }

            .hidden {
                display: none!important;
                visibility: hidden!important
            }

            p {
                line-height: 1.75;
                font-size: 1.1rem
            }

            .challenge {
                border: 1px solid #e0e0e0;
                background-color: #fafafa;
                border-radius: 3px;
                height: 65px;
                max-width: 300px;
                width: 100%;
                user-select: none
            }

            .challenge-container {
                width: 100%;
                height: 100%;
                justify-content: space-between;
                padding: 0 18px
            }

            .challenge-branding,.challenge-branding svg {
                width: 30px;
                height: 30px
            }

            .challenge-label {
                margin-left: 10px;
                font-size: 15px
            }

            .ctp-checkbox-label {
                cursor: pointer;
                height: 28px;
                display: flex;
                align-items: center
            }

            .ctp-checkbox-label input {
                position: absolute;
                opacity: 0;
                z-index: 9999;
                cursor: pointer;
                width: 28px;
                height: 28px
            }

            .challenge-verifying svg,.success-icon {
                display: flex;
                margin-right: 8px;
                width: 30px;
                height: 30px
            }

            input:checked~.mark,input:disabled~.mark,input:focus~.mark {
                border-color: #038127
            }

            .p1 {
                fill: none;
                stroke: #fff
            }

            .success-icon {
                border-radius: 50%;
                box-shadow: inset 0 0 0 #038127;
                animation: .5s cubic-bezier(.55,.085,.68,.53) both scale-up-center;
                stroke-width: 6px;
                stroke: #f8f8f8;
                stroke-miterlimit: 10
            }

            .success-icon .p1 {
                stroke-dasharray: 242;
                stroke-dashoffset: 242;
                box-shadow: inset 0 0 0 #038127;
                animation: .4s cubic-bezier(.65,0,.45,1) forwards stroke;
                animation-delay: .4s
            }

            .success-circle {
                stroke-dashoffset: 0;
                stroke-width: 2;
                stroke-miterlimit: 10;
                stroke: #038127;
                fill: #038127
            }

            @keyframes stroke {
                100% {
                    stroke-dashoffset: 0
                }
            }

            @keyframes scale {
                0%,100% {
                    transform: none
                }

                50% {
                    transform: scale3d(1,1,1)
                }
            }

            .ctp-checkbox-label .mark {
                transition: border-color .1s ease-in,border-radius .1s ease-in;
                z-index: 9998;
                border: 2px solid #6d6d6d;
                border-radius: 3px;
                background: #fff;
                width: 28px;
                height: 28px
            }

            .challenge-verifying svg {
                animation: 5s linear infinite rotate
            }

            .circle {
                stroke-width: 3px;
                stroke-linecap: round;
                stroke: #038127;
                stroke-dasharray: 0,100,0;
                stroke-dashoffset: 200;
                stroke-miterlimit: 1;
                stroke-linejoin: round
            }

            @keyframes rotate {
                100% {
                    transform: rotate(360deg)
                }
            }

            @keyframes unspin {
                40% {
                    stroke-width: 1px;
                    stroke-linecap: square;
                    stroke-dashoffset: 192
                }

                100% {
                    stroke-width: 0
                }
            }

            @keyframes scale-up-center {
                0% {
                    transform: scale(.01)
                }

                100% {
                    transform: scale(1)
                }
            }

            @media (max-width: 750px) {
                h1 {
                    font-size:2.25rem
                }

                h2 {
                    font-size: 1.25rem
                }
            }

            @media (max-width: 450px) {
                main {
                    margin:5rem auto
                }

                h1 {
                    font-size: 2rem
                }

                h2 {
                    font-size: 1.1rem
                }

                p {
                    font-size: 1rem
                }
            }

            @media (max-width: 350px) {
                .challenge-branding {
                    display:none
                }
            }
